css:
@-webkit-keyframes flash {
  from {
    background: #2196f3;
  }
  to {
    background: none;
  }
}
.atom-text-editor,
:host {
  background-color: rgba(0, 0, 0, 0);
  color: rgba(102, 102, 102, 0.8);
}
.atom-text-editor .invisible-character,
:host .invisible-character,
.atom-text-editor .indent-guide,
:host .indent-guide {
  color: rgba(51, 51, 51, 0.2);
}
.atom-text-editor .gutter,
:host .gutter {
  background-color: rgba(0, 0, 0, 0);
}
.atom-text-editor .gutter .line-number,
:host .gutter .line-number {
  opacity: 0.5;
}
.atom-text-editor .gutter .line-number.folded,
:host .gutter .line-number.folded,
.atom-text-editor .gutter .line-number:after,
:host .gutter .line-number:after,
.atom-text-editor .fold-marker:after,
:host .fold-marker:after {
  color: #d33682;
}
.atom-text-editor .selection .region,
:host .selection .region {
  background-color: rgba(220, 50, 47, 0.3);
}
.atom-text-editor .highlights .current-result .region,
:host .highlights .current-result .region {
  background-color: rgba(38, 139, 210, 0.6);
}
.atom-text-editor .highlights .find-result .region,
:host .highlights .find-result .region {
  border-bottom: 1px dotted rgba(38, 139, 210, 0.9) !important;
}
.atom-text-editor .line-number.cursor-line-no-selection,
:host .line-number.cursor-line-no-selection {
  background-color: rgba(255, 255, 255, 0.07);
}
.bracket-matcher .region {
  background-color: #ffffff;
  opacity: 0.2;
}
.comment {
  color: rgba(102, 102, 102, 0.5);
}
.entity {
  color: #f92672;
}
.keyword {
  color: #f92672;
  font-weight: bold;
}
.storage {
  color: #66d9ef;
}
.storage.type {
  color: #859900;
}
.constant {
  color: #ae81ff;
}
.constant.numeric,
.constant.boolean {
  color: #ae81ff;
}
.variable {
  color: #fd971f;
}
.delimiter,
.brace {
  color: rgba(102, 102, 102, 0.8);
}
.invalid.deprecated {
  text-decoration: underline;
  color: #dc322f;
}
.invalid.illegal {
  color: #dc322f;
}
.string {
  color: #e6db74;
}
.string .constant.character.escape {
  color: #dc322f;
}
.string.regexp {
  color: #2aa198;
}
.string.regexp .source.ruby.embedded,
.string.regexp .string.regexp.arbitrary-repitition {
  color: #dc322f;
}
